( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', 'ecbb5e3d-2c9b-4ea6-ba72-feb2790289a8', NULL, '0x47474caa8383e015c0b3f22b2ae2fd8b794e4c8e', 'From the Fragments of Tezuka Osamu - Mosaic Art', '[From the Fragments of Tezuka Osamu]

