Now, ‚ÄúFrom the Fragments of Tezuka Osamu‚Äù, the digital NFT art project based on numerous manga manuscripts by Tezuka Osamu, is finally revealed as the official NFT works authorized by Tezuka Productions. 


[Mosaic Art NFT]

A vast amount of manga manuscripts drawn by Osamu Tezuka were used in the creation of Mosaic Art NFT.

This art piece can be enjoyed in various ways. Seen from distance, it appeals to audience as a powerful integrated picture. Seen up close, each tiny piece gives off Tezuka‚Äôs exceptional enthusiasm for manga creation. This is one and only one art piece in the world. 

Only the owner can experience the overwhelming world of Tezuka Osamu.', '', 'from-the-fragments-of-tezuka-osamu-mosaic-art', 'https://tezuka-art.nftplus.io/', '' ),
