( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', '3109ac56-334d-4593-b25b-0149735425af', NULL, '0xd754937672300ae6708a51229112de4017810934', 'Deafbeef', 'Generative audiovisual art. Nothing but a C compiler. Pushing the limits of multimedia stored completely on-chain. 

Series 0 - Synth Poems are short generative music pieces, inspired by the sound of analog synthesizers. They are stored [on-chain](https://deafbeef.com/about.htm)

Each piece is generated at the time of minting from a random hash value, influencing musical elements including tempo, timbre, pitch and time signature. Simple rules lead to surprising variation, giving each piece it''s own distinctive personality, while retaining a common theme.

Although synth poems are audio focused, a fitting visualization is added as an ode to early computer graphics that used vector displays to visualize analog signals. What you see is a direct representation of the sound signal, as it would appear on an oscilloscope.

The code that generates the audiovisual is stored completely on-chain, allowing a user to reconstruct the media without having to trust IPFS or external storage.', '', 'deafbeef', 'https://www.deafbeef.com', '' ),
