( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', '790c34d4-62b8-4bfc-a847-8ecba45a86be', NULL, '0xaadc2d4261199ce24a4b0a57370c4fcf43bb60aa', 'Damien Hirst - The Currency', 'HENI is delighted to present The Currency, the first NFT collection by Damien Hirst. Reimagining the way NFTs are used, The Currency is a collection of 10,000 NFTs which correspond to 10,000 unique physical artworks which are stored in a secure vault in the UK. The works are now brought to life through their launch on the blockchain.

Starting with the creation of the physical artworks in 2016, The Currency explores the boundaries of art and currency‚Äîwhen art changes and becomes a currency, and when currency becomes art. Successful applicants will all initially receive NFTs. Ultimately, you have to decide between the digital NFT or the physical artwork, both of which are artworks in their own right. Whichever you pick, the other gets burned.

The collection is on the Palm blockchain, which is a new token-powered ecosystem for NFTs connected to Ethereum. It is 99% more energy efficient than proof of work systems such as Ethereum or Bitcoin. The Currency NFTs can be moved to Ethereum.', '', 'thecurrency', 'https://currency.nft.heni.com/', '' ),
