( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', '278f0422-0144-4077-8ab3-7a60cd9f182a', NULL, '0x6e96fb1f6d8cb1463e018a2cc6e09c64ed474dea', 'Mandelbrot Set Collection', 'The *Mandelbrot Set Collection* is a curated selection of points of the Mandelbrot, generated with a numerical algorithm and engraved into 1978 unique NFTs. Each work represents the neighborhood of one of our favorite points of the fractal, with a random zoom factor and colored with arbitrary gradients based on the number of iterations of the function f(z) = z^2 + c before the point diverges to infinity.

Not all the attributes are equally likely, thus giving rise to different degrees of scarcity for each artwork. In particular, higher zoom levels are limited and golden-colored points are very scarce. Attribution is random, so we wish you the best of luck in unveiling one of the most out-of-the-ordinary pieces. 

More info on [our website](https://mandelbrot.fractalnft.art/)

Mathematically linked to the [Julia Set Collection](https://opensea.io/collection/julia-set-collection) and the [Mandelbrot Trilogy Collection](https://opensea.io/collection/mandelbrot-trilogy-collection)', '', 'mandelbrot-set-collection', 'https://mandelbrot.fractalnft.art', '' ),
