( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', '29f8debc-8aa0-4f57-a8a6-a79489b0026e', NULL, '0x96ed81c7f4406eff359e27bff6325dc3c9e042bd', 'Weird Whales', 'Weird Whales is an NFT collection created by twelve-year-old programmer [Benyamin](https://linktr.ee/ObiWanBenoni) from London, UK who began learning to code at the age of five. The project started as an educational endeavour. Benyamin created all the base and trait layers for the whales (normal, zombie, ape, alien), he then generated 3350 unique digital collectibles programmatically using an open-source Python script.

