( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', 'b44fdaac-d734-474b-a253-182896cfd7d8', NULL, '0xa20f75be9427995e596788c29a10c7d734671251', 'Hypervision by Deadmau5 x Mad Dog Jones', 'deadmau5 is a Canadian electronic music producer, DJ, and musician. deadmau5 mainly produces progressive house music, though he also produces and DJs other genres of electronic music, including techno under the alias Testpilot. deadmau5 has received six Grammy Award nominations for his work. Michah Dowbak aka Mad Dog Jones is a multidisciplinary artist from Thunder Bay, Ontario. His works deftly interweave cyberpunk elements with the beauty and freedom of nature. As a lover of the wilderness, which was ever present where he grew up, he brings a fresh thematic to the metropolitan aesthetic, done up in citrus and neon tones of technology somehow rendered as a space naturally human. Over the last two years he has created artworks for Run The Jewels, Deadmau5, Jabbawockeez, Conor McGregor, Maroon 5 and Chromeo. His first and only IRL exhibit was AFTERL-IFE WORLD in Tokyo Sept-Nov 2019.', '', 'hypervision-by-deadmau5-x-mad-dog-jones', 'https://niftygateway.com/collections/deadmauxmdjopen', '' ),
