( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', 'ef187556-3050-4545-ae63-fc53fd7ded09', NULL, '0xc78337ccbb2d08492ec152e501491d3a76cd5172', 'J48BAFORMS', 'FROM THE DEPTHS OF THE GROTTO...

J48BAFORMS (Pronounced Jabbaforms) 
is a multifaceted artistic experiment minting at 0.25ETH a pop. A series of 4848 Works of art are available at random. An exciting array of different rarities are present, from original hand-drawings to animated works with accompanying musical scores. J48BAFORMS started with 1000 hand drawn ‚ÄúLEGACYFORMS‚Äù produced by the artist, which serves as the foundation for the series.

