( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', '459bcfdf-6ff0-446f-a58a-01af412e77f7', NULL, '0x936ebff82c75cb8b6a3baa519259af089396886a', 'Speculations by Sarah Meyohas', '1. All scenes from this series are captured in-camera. No editing, besides minor color correction.

2. This series of photographs is ongoing. After all, these images literally never end!

The analogy that created the endless loop: reflection is a metaphor for value. Value is created through replacement. In an exchange, one is in the place of the other. The light is caught bouncing between mirrors in an endless exchange ‚Äî a specular relation. 
 
This series was initially conceived for BitchCoin, a cryptocurrency as an artwork that playfully constructed value. The coin needed to be backed by a photograph, and this photograph needed to create value visually, deliberately, and perhaps with an illusory expansion of space to reference ‚Äúmining‚Äù and the idea of gold. And while the themes of infinity, reflection, and illusion are conceptually vast, it is also the the act of photographing ‚Äî to look at a mirror and instead of seeing myself, seeing a void ‚Äî that is metaphysical.', '', 'speculations-meyohas', 'http://www.sarahmeyohas.com', '' ),
