( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', '189f674a-a42d-472f-b989-13fda6daa20d', NULL, '0x664ac093f047a131403e9b1cbe3ff1df7e756429', 'IMMORTALZ - Ambary Assassins', 'A story telling NFT collection of 4517 IMMORTALZ created by Kevin Moses that gives you access to the first DAO manga writing group to produce the greatest Manga/Anime story and also the INFINITY club, a group of NFT and Crypto experts that give their inputs about the industry and upcoming projects. ‚ò†Ô∏è', '', 'theimmortalz', 'https://immortalz.io', '' ),
( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', '64c11836-5b39-4ebe-9767-86f770b22cd5', NULL, '0x9abb7bddc43fa67c76a62d8c016513827f59be1b', 'POW NFT', 'POW NFTs are the first ever mineable NFT, and are mined with an increasing level of difficulty using Proof of Work ‚Äì a fundamental feature of blockchain first described in Satoshi Nakamoto‚Äôs Bitcoin whitepaper. When a POW NFT is mined, a unique and increasingly rare ERC-721 token is created. The mining process prevents front-running and network congestion while maintaining security, and parallel mining-difficulty and price-demand-curves create natural, market-driven scarcity.

POW NFT atoms are generated according to a scarcity model relative to the natural distribution of elements. The element, ionic charge and generative properties of the render are all determined by the token‚Äôs hash ‚Äì an unpredictable result of the mining process. Every Atom also contains a unique generative music track.

Atom minting fees are not paid to the creator, they are distributed evenly to all Atoms from previous generations. Eligible Atoms accrue 0.000045 ETH from every new Atom that is minted.', '', 'pownft', 'http://www.pownft.com', '' ),
