( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', '9b65880f-92bf-4e46-85f8-2cf944db52e6', NULL, '0x62f8048d4476e22d2335b0a26b63d488c397b7d5', 'Vhils', 'Portuguese visual artist Alexandre Farto aka Vhils (b. 1987) has developed a unique visual language based on the removal of the surface layers of walls and other media with nonconventional tools and techniques, establishing symbolic reflections on identity, the relationship of interdependence between people and the surrounding environment, and life in contemporary urban societies, as well as the impact of development, the passage of time, and material transformation. Since 2005, he has presented his work in over 30 countries around the world in solo and group exhibitions, site-specific art interventions, artistic events and projects in various contexts ‚Äì from working with communities in the favelas of Rio de Janeiro, to collaborations with well-reputed artistic and museums such as the Contemporary Arts Center, Cincinnati (2020); Le Centquatre-Paris, Paris (2018); CAFA Art Museum, Beijing (2017); Hong Kong Contemporary Art Foundation, Hong Kong (2016); Palais de Tokyo etc...', '', 'vhils-artworks', 'http://www.vhils.com', '' ),
