( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', 'b9e0d500-dcdf-4bec-bd34-7639bcf15abb', NULL, '0x055700706718279e089523b5166e423c7537c4f1', 'ROOFTOPS.', 'The news just hit: New York was the epicenter of the pandemic. The weather was finally warming up after a long cold winter, and we were told to stay inside.
 
Times were uncertain, no one knew how long this would last.
Through my Brooklyn apartment window, I watched as New Yorkers found solace in the one place that was safe to be outside: their rooftops.
 
Rooftops turned into gyms, art studios, offices, and rehearsal spaces. I found inspiration watching the resilience of my fellow New Yorkers - in the true spirit of the city, making the most of a grim situation.
 
I picked up my camera to document what was unfolding in front of my eyes. I didn‚Äôt realize at the time that this was turning into my most important body of work, which was capturing this historical window of time. 

