Blockships is the first REAL NFT. Other NFTs like CryptoPunks do not save the image data on the Blockchain, only the url to the image is stored on the Blockchain. This means that if the server that stores the image data goes offline, the NFT will be lost. The Blockships on the other hand are directly stored on the Blockchain, so they will last for eternity!

Calculating the Blockship images requires lots of computations. The core of Blockships is an algorithm that computes unique Blockships based on block hashes. Performing these computation onchain would require huge gas fees. Because of this Blockships together with the Acria oracle developed a new method to initialize the Blockships via oracle nodes. This makes Blockships the first real, dec', '', 'blockship', 'https://blockships.io/', '' ),
