( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', '9dbb46ad-1261-46d0-a5e2-8efc1d6c4d91', NULL, '0x28b51ba8b990c48cb22cb6ef0ad5415fdba5210c', 'Feral File #001 - Social Codes', 'Artists have been working with code since the 1960s, and within that time frame, code has evolved from languages written by engineers to run on room-sized computers to artist-created coding languages running inside a web browser. In 2021, artists are writing code in many languages and environments; each programming language is like a different material to work with. Social Codes is an exhibition of software art, also called generative art. The work comprises code written by artists to create visual experiences. Some works in the exhibition relate to the visual histories of drawing, painting, animation, and video, but all of it is native digital art, in that each artwork is a performance of code choreographed by the artist. ‚Äî Casey Reas', '', 'feral-file-001-social-codes', 'https://feralfile.com', '' ),
