The NFTs you see here are all **playable animals**.

If you want to own a boss, check out [Wild Animal Marketplace](https://cryptoserval.io/marketplace) or [Alpha Animal Marketplace](https://opensea.io/collection/cryptoserval-alpha) here at OpenSea

