( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', '37138a31-e42b-4c63-9123-98aeb2fe050a', NULL, '0x495f947276749ce646f68ac8c248420045cb7b5e', 'Masked the series', 'Welcome to the art of masking. I started creating this series in 2020 after I hit a rough patch in my life. There were no significant rhymes or reasons as to why I started drawing figures with masks initially, but later on I sorted everything out and all it took was one piece. I find the idea of humans hiding our emotions behind non-physical masks to be the most fascinating dysfunctions that we suffer from. The idea that you never really know what a person is feeling is as concealing as it gets. This series reflects on a lot of emotions that I have since healed from but being able to share what I was feeling at the time feels right in the form of creativity.', '', 'masked-the-series', '', '' ),
