( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', '533a0b16-e142-4c38-92a6-548c4c60592c', NULL, '0xb9a9f29c037d09d284e6e218519c7bb67fbd2ef8', 'Familiars (for Adventurers)', 'A collection of mighty familiars for the Loot project adventurers. 

