( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', 'ead55c36-2102-42a1-b6d4-9f8c18864521', NULL, '0xff4245b8fd43f75476608a94768ebb29bb678c2c', 'Yokai Masks', 'Welcome to the Crypto Afterlife

The Yokaimasks collection seeks to capture and celebrate the many faces of the elusive Yokai through artwork that expresses their features and forms. We are excited to bring to life this rich tradition of storytelling by merging our art with the digital asset ownership features of NFTs.

There will be only 3,000 masks total in the Yokaimasks collection. Each mask comes with an unique set of attributes that makes each one special. No two masks are alike. Viewers will be able to analyze these differences by using six key elements as their guide, allowing them to grade the relative rarity of each mask.', '', 'yokai-masks', 'https://yokai.money', '' ),
( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', 'c0890eee-f888-4127-b3f4-83cd37a89c54', NULL, '0x743d270ed907b0ce4013605be667f0117b637c9e', 'Bored Degen Crypto Arcade Official', 'The PC drop is a generative NFT collection consisting of 1,337(leet) unique vintage/retro themed home office set ups, and it is your portal into the BDCA Universe.', '', 'bdcapcofficial', 'https://bdca.io', '' ),
( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', 'e1e6a387-7599-437e-86df-e91797539fbc', NULL, '0x93975b0ac3c16ed0478e916921f84417e29f473f', 'Bingo! - on Forma', 'Inspired by fond childhood memories, Bingo! takes a timeless, luck-based game and adds a strategic twist with a burn-to-merge contract mechanism. Collect enough boards to get bingo, or go even further to see your board evolve. Cells in each minted board are randomly filled in and from there, boards can be merged - two into one - by burning. The resulting board will have the union of cells filled in from the merged boards and new, random styling. The supply will deflate as boards are merged. Happy playing!', '', 'bingo-on-forma', 'https://www.forma.art', '' ),
( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', '0ef4be2c-abd8-4f54-8e20-639530cf4358', NULL, '0xe3870569f9e1836960bf30b5a45fc743cef0ab0e', 'Splinterlands', 'Splinterlands is a blockchain-based collectible card game where thousands of players battle daily in live PvP combat. Buy and sell the NFT cards on the decentralized marketplace and use them to battle in the ranked play seasons or in daily tournaments with thousands of dollars worth of prizes available every week!', '', 'splinterlands', 'https://splinterlands.io', '' ),
( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', '2b54bb8b-6e8c-4ee3-9613-408331ee1e94', NULL, '0xbc4359c1b81fafbce77b216b3b1b948de04f8d32', 'NFT Virtual Machine', 'I am a Virtual Machine

I make NFT art

Collect my NFT art', '', 'nft-virtual-machine', 'https://app.rarible.com/collection/0xbc4359c1b81fafbce77b216b3b1b948de04f8d32', '' ),
( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', '852309d4-1325-4e03-8bbe-f63a701e4a4e', NULL, '0xde41fd6dfa8194a1b32a91cb1313402007a31173', 'BillionDollarDapp', 'BillionDollarDapp is a collaborative cryptographic generative art decentralized application (Dapp) on the Ethereum network.

Each pixel is unique because the vector art is generated based on the cryptographic hash produced by the Ethereum network during the creation process.

Only 32 x 32 pixels will ever exist. Then, these pixels will only be available on the open market or rented.

The threads depicted on each pixel represent our shared connections to different people, milestones, or causes that we individually care about.  Pixel owners can change the color and dedication text for each pixel.  

In order to keep the artwork dynamic over time, anyone can rent pixels from the pixel owner to temporarily update the pixel color and dedication text.  Pixel owners get rental income transferred to them at time of rental.

As the larger collaborative artwork grows, the threads on each pixel interact with adjacent pixels in countless ways.', '', 'billiondollardapp', 'http://billiondollardapp.com', '' ),
