( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', 'f9e98be7-184e-48fe-a7f7-181b53dadcec', NULL, '0x07bca0695746b4644d674a7e2e5a816fada2fdfb', 'RAC x Reisinger Andrs', 'RAC and Andr√©s Reisinger team up once again after their initial collaboration on RAC''s third studio album "BOY" and the record setting "Elephant Dreams" NFT series in late 2020. Their new project "YOU" is based around the idea of objects left behind from previous relationships - those small details that feel completely mundane but intensely personal. It''s about how we tie our life experiences to these minute segments of our lives and how impossible it can feel to let something go that represents them - almost like proof that it happened. It''s about what you hold on to simply because if you get rid of it, you''re forced to move on. At the same time, while it''s sad that it ended, you''re still glad that it happened. "YOU" at it''s core is about the objects that keep a distant memory alive. RAC is a Grammy award winning musician and Reisinger is an award winning designer at the forefront of the new digital art movement.', '', 'rac-x-reisinger-andrs', 'https://niftygateway.com/collections/racyouauctions', '' ),
( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', '0d855eec-dc9f-42e4-96a5-fef59bc8084d', NULL, '0x35a397b958691f6f27d2f7eb0138a3fd4556393a', 'THE CYB3RGRACES 2084 Intermezzo by PR1MAL CYPHER', 'From PR1MAL CYPHER, "Especially in times like these, when we are increasingly confronted with the finite nature of things in the face of a pandemic crisis, many things cannot be planned as we would like to. Basically, there is not much that can be planned in general, because life is paving its own way. So it was with this mini-series of CYB3RGRACES, which originally and after the completion of the first painting ''Grace of Faith'' was to become part of the ''2084'' series. As it turned out, however, the intention was to develop an independent series with unmistakable stylistic elements of the great designer and painter Alphonse Mucha. Mucha is known to me since early days as a special artist, who set new standards with his aesthetics and the claim on my part was to successfully achieve an amalgamation of certain Art Deco elements with a haunting Cyberpunk style. The result: the graces."', '', 'the-cyb3rgraces-2084-intermezzo-by-pr1mal-cypher', 'https://niftygateway.com/collections/pr1mal2', '' ),
