( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', 'e62629fa-4d55-407c-8306-308704c5bf1b', NULL, '0x10e0271ec47d55511a047516f2a7301801d55eab', 'Dreams of EVM', 'Explore the EVM with dreams

The EVM‚Äôs physical instantiation can‚Äôt be described in the same way that one might point to a cloud or an ocean wave, but it does exist as one single entity maintained by thousands of connected computers running an Ethereum client.

The Ethereum protocol itself exists solely for the purpose of keeping the continuous, uninterrupted, and immutable operation of this special state machine; It''s the environment in which all Ethereum accounts and smart contracts live. At any given block in the chain, Ethereum has one and only one ''canonical'' state, and the EVM is what defines the rules for computing a new valid state from block to block.', '', 'dreams-of-evm', 'https://verynifty.io/', '' ),
