( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', '2ad5310b-4ad1-4412-8a65-d75a765db941', NULL, '0xb49cce83533b4627945b3cb2ffd63a6217289c08', 'Depictives', 'This collection was generated using an algorithm built upon fundamental mathematics, colour theory and design composition with the purpose of constructing abstract pieces inspired by the work of Wassily Kandinsky, with particular reference to his work during the 1920s and his time at the Bauhaus. Considered to be the father of the abstract movement, his engaging works transform a seemingly random collection of elements into pieces that produce order and cohesion, through purposeful interactions between these shapes.

The Depictives design algorithm explores and develops upon this idea of purpose through the seemingly chaotic; generating a canvas of colours, collisions, origins and vectors that combine to assemble shapes and outcomes. Even with the sheer number of random variables, parameters and potential outputs, for those who look a little closer, order can be found within these 2048 unique pieces.', '', 'depictives', 'https://www.expfunction.com/depictives/', '' ),
