( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', 'bd0c5c8a-54b5-4a56-b6eb-037b954377e6', NULL, '0x495f947276749ce646f68ac8c248420045cb7b5e', 'Luis Dalvan - Does the city exist without you?', 'Luis Dalvan - Does the city exist without you?

