( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', '8841b40f-7678-43cf-a776-ba224c750189', NULL, '0x22203962e3f22fc1e5a1a1c31d9b76e3c08136e4', 'DontMakeArt', '500 generative conceptual art works showcasing textual statements about web3 and NFT art in 2021.

