( '94c754fe-e06c-4d2b-bb76-2faa240b5bb8', 'c726fc5b-f8f8-4ab3-a89e-d0312fe1349c', NULL, '0x29c9e04e05c5d261836e458bc5b779a7de3c58d6', 'Feral File #007 - Reflections in the Water', 'Working with AI art sometimes feels like gazing into a pond of water. In a still pond, we see a clear, gently blurred version of ourselves staring back at us, while turbulent waters return rippled echoes of our shape. These changing reflections of ourselves are similar to images generated from data, which can be hyperrealistic depictions of the original, or images that are surreal and barely recognizable, as errors creep in.
This exhibition looks at the way artists represent nature and humans, using the latest machine learning technologies to conjure seascapes, imaginary marine creatures, autumn leaves, and musings on the human form. Masks and faces akin to the grotesque rear their heads, reminding us of the early errors of these technologies and the eternal human fascination with depicting ourselves. These artists present AI as a tool to craft new reflections on perennial subjects, as well as a creative partner, conjuring new landscapes, creatures, and forms. ‚ÄîLuba Elliott', '', 'feral-file-007-reflections-in-the-water', 'https://feralfile.com', '' ),
